import React from "react";

export default function Why()
{
    let mainStyle = {
        margin: "2% 10% 2% 10%",
    }
    let theadStyle = {
        fontSize: "24px",
        fontWeight: "bold",
        
    }
    let trStyle = {
        fontSize: "20px",
        justifyContent: "space-between"
    }
    return (
        <main style={mainStyle}>
            <h1>Why should we treat under this organization?</h1>
            <table>
                <thead style = {theadStyle}>
                    <td>Our Vision</td>
                    <td>Our Mission</td>
                    <td>Our Values</td>
                </thead>
                <tbody>
                    <tr style={trStyle}>
                        <td>To treat people with quality treatment at fair price.</td>
                        <td>To spread the influence of Ayurvedic treatment among the people of society.</td>
                        <td>
                            <ul>
                                <li>Quality treatment</li>
                                <li>Patient's satisfaction</li>
                                <li>Improving quality of living</li>
                            </ul>
                        </td>
                    </tr>
                </tbody>
            </table>
            {/* <p>There are a lot of cases where people are unable to treat using most of the doctors. But, they got treated under this organization</p> */}
        </main>
    )
}
